  \"2013-03-19T00:31:57.621269\",\n\t\"name\": \"major-oxide-minor-oxide-trace-element-geochemical-and-non-carbonate-carbon-data-from-rocks-2006\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The rock samples in this publication were
  collected in 2006 during geologic field mapping within the Council airborne geophysical
  survey tract. The analyses were acquired to aid interpretation and development of
  the geologic map and evaluation of the area's mineral potential. To further geologic
  understanding of the area, igneous and metamorphic rock samples were selected for
  whole-rock geochemical analysis. Unweathered or minimally weathered rock samples
  were preferentially selected for analysis. Non-carbonate carbon analyses were obtained
  to determine the percentage of graphite in metasedimentary rocks. To help evaluate
  the area's mineral resource potential, rock samples were selected for geochemical
